    function AP(mapLayer,groupPoints,groupNumber){
      
        var mro_Map = unsafeWindow.Waze.map;
        var mro_OL = unsafeWindow.OpenLayers;
        var groupLabel = groupNumber;
        var groupName = groupNumber;
        var color = "#FF6600";
      
        var style = {
            strokeColor: color,
            strokeOpacity: 0.8,
            strokeWidth: 3,
            fillColor: color,
            fillOpacity: 0.25,
            label: groupLabel,
            labelOutlineColor: "Black",
            labelOutlineWidth: 3,
            fontSize: 14,
            fontColor: color,
            fontOpacity: 0.85,
            fontWeight: "bold"  
        };
    
        var attributes = {
            name: groupName,
            number: groupNumber,
            holes: "false"
        };
      
        var rings = [];
        for (j = 0; j < groupPoints.length; j++) {
            var pnt= [];
            for(i=0;i<groupPoints[j].length;i++){
                convPoint = new OpenLayers.Geometry.Point(groupPoints[j][i].lon,groupPoints[j][i].lat).transform(new OpenLayers.Projection("EPSG:4326"), mro_Map.getProjectionObject());
                pnt.push(convPoint);
            }
              
            var ring = new mro_OL.Geometry.LinearRing(pnt);
            rings.push(ring);
        }
        var polygon = new mro_OL.Geometry.Polygon(rings);
      
        var feature = new mro_OL.Feature.Vector(polygon,attributes,style);
        mapLayer.addFeatures([feature]);
  
    }
  
